 available at:<br><br> <a href='http://www.github.com/ashtonthomas/gwt-seminar'>http://www.github.com/ashtonthomas/gwt-seminar<\/a> <\/p> <br><br> Here are some of the flyers for this event:<br> <br> <a href='http://www.andrew.cmu.edu/user/acthomas/flyer.pdf'>Click Here for Flyer 1<\/a><br><br> <a href='http://www.andrew.cmu.edu/user/acthomas/flyer2.pdf'>Click Here for Flyer 2<\/a><br><br> <a href='http://www.andrew.cmu.edu/user/acthomas/flyer3.pdf'>Click Here for Flyer 3<\/a> <\/div>",r0="<div id='content_area'> <h2>Zero to \"Enterprise\" in 60 minutes<\/h2> <br> <a href='#rsvp'>RSVP<\/a> for a free seminar on GWT 2.1 and building powerful Rich Internet Applications <br><br> <ul> <li>Model-View-Controller (MVP) with Activities<\/li> <li>EventBus and the Command Pattern<\/li> <li>Dependency Injection in client code using Gin<\/li> <li>Data Synchronization using the RequestFactory<\/li> <li>History and Navigation (keeping the \"back\" button)<\/li> <li>Decoupling UI's using UiBinder<\/li> <li>DTO's, Domains, and Databases<\/li> <li>Dependency Management / POM with Maven<\/li> <\/ul> <br><br> <h2>This site is a GWT App<\/h2> And you can download the source -&gt; <a href='http://github.com/ashtonthomas/gwt-seminar'>From GitHub<\/a>. <br><br><br><br> <h3>This site has a mobile version too<\/h3> Just to show how these things work in GWT.  <\/div>",M0="<h2>GWT Introduction<\/h2> <center> <object height='340' width='560'><param name='movie' value='http://www.youtube.com/v/ShkYDPN5Knc?fs=1&amp;hl=en_US&amp;rel=0'><param name='allowFullScreen' value='true'><param name='allowscriptaccess' value='always'><embed allowfullscreen='true' allowscriptaccess='always' height='340' src='http://www.youtube.com/v/ShkYDPN5Knc?fs=1&amp;hl=en_US&amp;rel=0' type='application/x-shockwave-flash' width='560'><\/embed><\/object> <\/center> <br><br> <h2>More Advanced Video<\/h2> <center> <object height='340' width='560'><param name='movie' value='http://www.youtube.com/v/M5x6E6ze1x8?fs=1&amp;hl=e
